// Name: TurboAPI
// ID: TeksTurboAPI
// Description: GET and POST requests in Scratch!
// By: Tek <https://github.com/Tekinical/>

(function (Scratch) {
  "use strict";

  let APIResponse = null;
  let JsonThing = null;

  let Main =
    "data:image/png;base64,";

  let Rep =
    "data:image/png;base64,";

  class TurboAPI {
    getInfo() {
      return {
        id: "TeksTurboAPI",
        name: "TurboAPI",
        menuIconURI: Main,
        color1: "#FF4C4C",
        blocks: [
          {
            opcode: "getRequest",
            blockType: Scratch.BlockType.REPORTER,
            text: "GET Request to [web]",
            arguments: {
              web: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "Website Endpoint",
              },
            },
          },
          {
            opcode: "sendPost",
            blockType: Scratch.BlockType.COMMAND,
            text: "Send a Post Request to [endpoint] with [arg]",
            arguments: {
              endpoint: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "Website Endpoint",
              },
              arg: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "Arguments",
              },
            },
          },
        ],
      };
    }

    getRequest(args) {
      return Scratch.fetch(args.web)
        .then((r) => r.text())
        .catch(() => "");
    }

    sendPost(args) {
      Scratch.fetch(args.endpoint, {
        method: "POST",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: args.arg,
      })
        .then((r) => r.text())
        .catch(() => "");
    }
  }

  Scratch.extensions.register(new TurboAPI());
})(Scratch);
